import React from 'react'

import {Dialog, Button} from '@material-ui/core'
import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles(theme => ({
  root: {
    top: 0,
  }
}))


function ProjectDialog({openDetail, setOpenDetail}) {
  const classes = useStyles()
  return (
    <Dialog open={openDetail} maxWidth="xs" onClose={()=>setOpenDetail(false)} classes={{paper: classes.root}}>
      <img src="https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg" alt="" srcset="" style={{height: 350}} 
      />
      <Button color="secondary" onClick={()=>setOpenDetail(false)}>X</Button>
    </Dialog>
  )
}

export default ProjectDialog
